import styled from "styled-components";

export const Page = styled.div`
  position: relative;
  margin-bottom: 80vh;
  background: #fff;
  z-index: 1;
`;

export const Intro = styled.div`
  min-height: 100vh;
  width: 100vw;
  background-color: #fff;
  z-index: 1;
`;
